(24, 1, 'Jan 4 maths', 'MCQ-2883542171', '23408||4894', '[{\"ans\": 4837, \"points\": \"5\", \"options\": [{\"ans\": false, \"option_id\": 4835, \"input_name\": \"A) 9mp\", \"input_photo\": \"\"}, {\"ans\": false, \"option_id\": 4836, \"input_name\": \"B) 20mp\", \"input_photo\": \"\"}, {\"ans\": true, \"option_id\": 4837, \"input_name\": \"C) 5m + 4p\", \"input_photo\": \"\"}, {\"ans\": false, \"option_id\": 4838, \"input_name\": \"D) 4m + 5p\", \"input_photo\": \"\"}], \"ans_mode\": false, \"field_id\": 23394, \"select_type\": \"multiple_questions_3\", \"answer_review\": \"Review For Question 1\", \"shouldDisable\": true, \"questions_type\": [{\"name\": \"Short Answer\", \"value\": \"shot_questions_1\"}, {\"name\": \"Paragraph\", \"value\": \"paragraph_questions_2\"}, {\"name\": \"Multiple Choice\", \"value\": \"multiple_questions_3\"}, {\"name\": \"Description\", \"value\": \"only_paragraph_5\"}], \"questions_photo\": \"\", \"questions_title\": \"<p>1.</p><p>On Saturday afternoon, Armand sent m text messages each hour for 5 hours, and Tyrone sent p text messages each hour for 4 hours. Which of the following represents the total number of messages sent by Armand and Tyrone on Saturday afternoon?&nbsp;</p>\"}, {\"ans\": 4840, \"points\": \"5\", \"options\": [{\"ans\": false, \"option_id\": 4839, \"input_name\": \"A) Kathy will complete the repairs within 108 days.\", \"input_photo\": \"\"}, {\"ans\": true, \"option_id\": 4840, \"input_name\": \"B) Kathy starts each week with 108 phones to fix.\", \"input_photo\": \"\"}, {\"ans\": false, \"option_id\": 4841, \"input_name\": \"C) Kathy repairs phones at a rate of 108 per hour.\", \"input_photo\": \"\"}, {\"ans\": false, \"option_id\": 4842, \"input_name\": \"D) Kathy repairs phones at a rate of 108 per day.\", \"input_photo\": \"\"}], \"ans_mode\": false, \"field_id\": 23395, \"select_type\": \"multiple_questions_3\", \"answer_review\": \"Review For Question 2\", \"shouldDisable\": true, \"questions_type\": [{\"name\": \"Short Answer\", \"value\": \"shot_questions_1\"}, {\"name\": \"Paragraph\", \"value\": \"paragraph_questions_2\"}, {\"name\": \"Multiple Choice\", \"value\": \"multiple_questions_3\"}, {\"name\": \"Description\", \"value\": \"only_paragraph_5\"}], \"questions_photo\": \"\", \"questions_title\": \"<p>2.</p><p>Kathy is a repair technician for a phone company. Each week, she receives a batch of phones that need repairs. The number of phones that she has left to fix at the end of each day can be estimated with the equation P = 108  23d , where P is the number of phones left and d is the number of days she has worked that week. What is the meaning of the value 108 in this equation?</p>\"}, {\"ans\": 4843, \"points\": \"5\", \"options\": [{\"ans\": true, \"option_id\": 4843, \"input_name\": \"A) 3\", \"input_photo\": \"\"}, {\"ans\": false, \"option_id\": 4844, \"input_name\": \"B) 5.7\", \"input_photo\": \"\"}, {\"ans\": false, \"option_id\": 4845, \"input_name\": \"C) 9.5\", \"input_photo\": \"\"}, {\"ans\": false, \"option_id\": 4846, \"input_name\": \"D) 14.3\", \"input_photo\": \"\"}], \"ans_mode\": false, \"field_id\": 23396, \"select_type\": \"multiple_questions_3\", \"answer_review\": \"Review For Question \", \"shouldDisable\": true, \"questions_type\": [{\"name\": \"Short Answer\", \"value\": \"shot_questions_1\"}, {\"name\": \"Paragraph\", \"value\": \"paragraph_questions_2\"}, {\"name\": \"Multiple Choice\", \"value\": \"multiple_questions_3\"}, {\"name\": \"Description\", \"value\": \"only_paragraph_5\"}], \"questions_photo\": \"\", \"questions_title\": \"<p>3.</p><p class=\\\"ql-align-center\\\">h = 3a + 28.6</p><p>A pediatrician uses the model above to estimate the height h of a boy, in inches, in terms of the boys age a, in years, between the ages of 2 and 5. Based on the model, what is the estimated increase, in inches, of a boys height each year?</p>\"}, {\"ans\": 4850, \"points\": \"5\", \"options\": [{\"ans\": false, \"option_id\": 4847, \"input_n