(75, 24, 'MCQ-2883542171', 23394, 'multiple_questions_3', '<p>1.</p><p>On Saturday afternoon, Armand sent m text messages each hour for 5 hours, and Tyrone sent p text messages each hour for 4 hours. Which of the following represents the total number of messages sent by Armand and Tyrone on Saturday afternoon?&nbsp;</p>', 'A) 9mp||B) 20mp||C) 5m + 4p||D) 4m + 5p', '4835||4836||4837||4838', '4837', NULL, '5', 'Review For Question 1', '2020-12-14 12:09:12', '2021-01-04 19:12:34'),
(76, 24, 'MCQ-2883542171', 23395, 'multiple_questions_3', '<p>2.</p><p>Kathy is a repair technician for a phone company. Each week, she receives a batch of phones that need repairs. The number of phones that she has left to fix at the end of each day can be estimated with the equation P = 108  23d , where P is the number of phones left and d is the number of days she has worked that week. What is the meaning of the value 108 in this equation?</p>', 'A) Kathy will complete the repairs within 108 days.||B) Kathy starts each week with 108 phones to fix.||C) Kathy repairs phones at a rate of 108 per hour.||D) Kathy repairs phones at a rate of 108 per day.', '4839||4840||4841||4842', '4840', NULL, '5', 'Review For Question 2', '2020-12-14 12:09:12', '2021-01-04 19:12:34'),
(77, 24, 'MCQ-2883542171', 23396, 'multiple_questions_3', '<p>3.</p><p class=\"ql-align-center\">h = 3a + 28.6</p><p>A pediatrician uses the model above to estimate the height h of a boy, in inches, in terms of the boys age a, in years, between the ages of 2 and 5. Based on the model, what is the estimated increase, in inches, of a boys height each year?</p>', 'A) 3||B) 5.7||C) 9.5||D) 14.3', '4843||4844||4845||4846', '4843', NULL, '5', 'Review For Question ', '2020-12-14 12:09:12', '2021-01-04 19:12:34'),
(78, 24, 'MCQ-2883542171', 23397, 'multiple_questions_3', '<p>4.</p><p class=\"ql-align-center\">b = 2.35 + 0.25x</p><p class=\"ql-align-center\">c = 1.75 + 0.40x</p><p>In the equations above, b and c represent the price per pound, in dollars, of beef and chicken, respectively, x weeks after July 1 during last summer. What was the price per pound of beef when it was equal to the price per pound of chicken?</p>', 'A) $2.60||B) $2.85||C) $2.95||D) $3.35', '4847||4848||4849||4850', '4850', NULL, '5', 'Review For Question ', '2020-12-14 12:09:12', '2021-01-04 19:12:34'),
(79, 24, 'MCQ-2883542171', 23398, 'multiple_questions_3', '<p>5.</p><p class=\"ql-align-center\">3x + 4y = 23</p><p class=\"ql-align-center\">2y  x = 19</p><p>What is the solution (x, y) to the system of equations above?</p>', 'A) (5, 2)||B) (3, 8)||C) (4, 6)||D) (9, 6)', '4851||4852||4853||4854', '4852', NULL, '5', 'Review For Question ', '2020-12-14 12:09:12', '2021-01-04 19:12:34'),
(80, 24, 'MCQ-2883542171', 23399, 'multiple_questions_3', '<p>6.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>A hospital stores one type of medicine in 2-decagram containers. Based on the information given in the box above, how many 1-milligram doses are there in one 2-decagram container?</p>', 'A) 0.002||B) 200||C) 2,000||D) 20,000', '4855||4856||4857||4858', '4858', NULL, '5', 'Review For Question 1', '2020-12-14 12:09:12', '2021-01-04 19:12:34'),
(81, 24, 'MCQ-2883542171', 23400, 'multiple_questions_3', '<p>7.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>The number of rooftops with solar panel installations in 5 cities is shown in the graph above. If the total number of installations is 27,500, what is an appropriate label for the vertical axis of the graph?</p>', 'A) Number of installations (in tens)||B) Number of installations (in hundreds)||C) Number of installations (in thousands)||D) Number of installations (in tens of thousands)', '4859||4860||4861||4862', '4861', NULL, '5', '', '2020-12-14 12:36:03', '2021-01-04 19:12:34'),
(82, 24, 'MCQ-2883542171', 23401, 'multiple_questions_3', '<p>8.</p><p>Which of the following numbers is NOT a solution to the inequality 3x 5  4x 3?</p>', 'A) 1||B) 2||C) 3||D) 5', '4863||4864||4865||4866', '4863', NULL, '5', '', '2020-12-14 12:36:03', '2021-01-04 19:12:34'),
(83, 24, 'MCQ-2883542171', 23402, 'multiple_questions_3', '<p>9.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>Based on the histogram above, of the following, which is closest to the average (arithmetic mean) number of seeds per apple?</p>', 'A) 4||B) 5||C) 6||D) 7', '4867||4868||4869||4870', '4869', NULL, '5', '', '2020-12-14 12:36:03', '2021-01-04 19:12:34');
