(84, 24, 'MCQ-2883542171', 23403, 'multiple_questions_3', '<p>10.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>A group of tenth-grade students responded to a survey that asked which math course they were currently enrolled in. The survey data were broken down as shown in the table above. Which of the following categories accounts for approximately 19 percent of all the survey respondents?</p>', 'A) Females taking Geometry||B) Females taking Algebra II||C) Males taking Geometry||D) Males taking Algebra I', '4871||4872||4873||4874', '4873', NULL, '5', '', '2020-12-14 12:36:03', '2021-01-04 19:12:34'),
(85, 24, 'MCQ-2883542171', 23404, 'multiple_questions_3', '<p>11.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>The table above lists the lengths, to the nearest inch, of a random sample of 21 brown bullhead fish. The outlier measurement of 24 inches is an error. Of the mean, median, and range of the values listed, which will change the most if the 24-inch measurement is removed from the data?</p>', 'A) Mean||B) Median||C) Range||D) They will all change by the same amount.', '4875||4876||4877||4878', '4877', NULL, '5', '', '2020-12-14 12:36:03', '2021-01-04 19:12:34'),
(86, 24, 'MCQ-2883542171', 23405, 'multiple_questions_3', '<p>12.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>The complete graph of the function f is shown in the <strong>xy</strong>-plane above. For what value of x is the value of f (x) at its minimum?</p>', 'A) 5||B) 3||C) 2||D) 3', '4879||4880||4881||4882', '4880', NULL, '5', '', '2020-12-14 12:36:03', '2021-01-04 19:12:34'),
(87, 24, 'MCQ-2883542171', 23406, 'multiple_questions_3', '<p>13.</p><p>A food truck sells salads for $6.50 each and drinks for $2.00 each. The food trucks revenue from selling a total of 209 salads and drinks in one day was $836.50. How many salads were sold that day?</p>', 'A) 77||B) 93||C) 99||D) 105', '4883||4884||4885||4886', '4884', NULL, '5', '', '2020-12-14 12:36:03', '2021-01-04 19:12:34');
