(88, 24, 'MCQ-2883542171', 23407, 'multiple_questions_3', '<p>14.</p><p>A square field measures 10 meters by 10 meters. Ten students each mark off a randomly selected region of the field; each region is square and has side lengths of 1 meter, and no two regions overlap. The students count the earthworms contained in the soil to a depth of 5 centimeters beneath the grounds surface in each region. The results are shown in the table below.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>Which of the following is a reasonable approximation of the number of earthworms to a depth of 5 centimeters beneath the grounds surface in the entire field?</p>', 'A) 150||B) 1,500||C) 15,000||D) 150,000', '4887||4889||4890||4891', '4889', NULL, '5', '', '2020-12-14 12:36:03', '2021-01-04 19:12:34'),
(89, 24, 'MCQ-2883542171', 23408, 'multiple_questions_3', '<p>15.</p><p>Katarina is a botanist studying the production of pears by two types of pear trees. She noticed that Type A trees produced 20 percent more pears than Type B trees did. Based on Katarinas observation, if the Type A trees produced 144 pears, how many pears did the Type B trees produce</p>', 'A) 115||B) 120||C) 124||D) 173', '4888||4892||4893||4894', '4893', NULL, '5', '', '2020-12-14 12:36:03', '2021-01-04 19:12:34'),
(90, 25, 'MCQ-7590175771', 72828, 'multiple_questions_3', '<p>1.</p><p>Katarina is a botanist studying the production of pears by two types of pear trees. She noticed that Type A trees produced 20 percent more pears than Type B trees did. Based on Katarinas observation, if the Type A trees produced 144 pears, how many pears did the Type B trees produce?</p>', 'A) 115||B) 120||C) 124||D) 173', '57642||57643||57644||57645', '57644', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
