(97, 25, 'MCQ-7590175771', 72835, 'multiple_questions_3', '<p>8.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>The number of rooftops with solar panel installations in 5 cities is shown in the graph above. If the total number of installations is 27,500, what is an appropriate label for the vertical axis of the graph?</p>', 'A) Number of installations (in tens)||B) Number of installations (in hundreds)||C) Number of installations (in thousands)||D) Number of installations (in tens of thousands)', '57670||57671||57672||57673', '57672', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28');
