(98, 25, 'MCQ-7590175771', 72836, 'multiple_questions_3', '<p>9.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>Based on the histogram above, of the following, which is closest to the average (arithmetic mean) number of seeds per apple?</p>', 'A) 4||B) 5||C) 6||D) 7', '57674||57675||57676||57677', '57676', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(99, 25, 'MCQ-7590175771', 72837, 'multiple_questions_3', '<p>10.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>A group of tenth-grade students responded to a survey that asked which math course they were currently enrolled in. The survey data were broken down as shown in the table above. Which of the following categories accounts for approximately 19 percent of all the survey respondents?</p>', 'A) Females taking Geometry||B) Females taking Algebra II||C) Males taking Geometry||D) Males taking Algebra I', '57678||57679||57680||57681', '57680', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(100, 25, 'MCQ-7590175771', 72838, 'multiple_questions_3', '<p>11.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>The table above lists the lengths, to the nearest inch, of a random sample of 21 brown bullhead fish. The outlier measurement of 24 inches is an error. Of the mean, median, and range of the values listed, which will change the most if the 24-inch measurement is removed from the data?</p>', 'A) Mean||B) Median||C) Range||D) They will all change by the same amount.', '57682||57683||57684||57685', '57684', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28');
