(101, 25, 'MCQ-7590175771', 72839, 'multiple_questions_3', '<p>12.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>The complete graph of the function f is shown in the <strong>xy</strong>-plane above. For what value of x is the value of f (x) at its minimum?</p>', 'A) 5||B) 3||C) 2||D) 3', '57686||57687||57688||57689', '57687', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(102, 25, 'MCQ-7590175771', 72840, 'multiple_questions_3', '<p>13.</p><p>On Saturday afternoon, Armand sent m text messages each hour for 5 hours, and Tyrone sent p text messages each hour for 4 hours. Which of the following represents the total number of messages sent by Armand and Tyrone on Saturday afternoon?&nbsp;</p>', 'A) 9mp||B) 20mp||C) 5m + 4p||D) 4m + 5p', '57690||57691||57692||57693', '57692', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(103, 25, 'MCQ-7590175771', 72841, 'multiple_questions_3', '<p>14.</p><p>Kathy is a repair technician for a phone company. Each week, she receives a batch of phones that need repairs. The number of phones that she has left to fix at the end of each day can be estimated with the equation P = 108  23d, where P is the number of phones left and d is the number of days she has worked that week. What is the meaning of the value 108 in this equation?</p>', 'A) Kathy will complete the repairs within 108 days.||B) Kathy starts each week with 108 phones to fix.||C) Kathy repairs phones at a rate of 108 per hour.||D) Kathy repairs phones at a rate of 108 per day.', '57694||57695||57696||57697', '57695', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(104, 25, 'MCQ-7590175771', 72842, 'multiple_questions_3', '<p>15.</p><p class=\"ql-align-center\">3x + 4y = 23</p><p class=\"ql-align-center\">2y  x = 19</p><p>What is the solution (x, y) to the system of equations above?</p>', 'A) (5, 2)||B) (3, 8)||C) (4, 6)||D) (9, 6)', '57698||57699||57700||57701', '57699', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(105, 25, 'MCQ-7590175771', 72843, 'multiple_questions_3', '<p>16.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>The number of rooftops with solar panel installations in 5 cities is shown in the graph above. If the total number of installations is 27,500, what is an appropriate label for the vertical axis of the graph?</p>', 'A) Number of installations (in tens)||B) Number of installations (in hundreds)||C) Number of installations (in thousands)||D) Number of installations (in tens of thousands)', '57702||57703||57704||57705', '57704', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
