(108, 25, 'MCQ-7590175771', 72846, 'multiple_questions_3', '<p>19.</p><p>A square field measures 10 meters by 10 meters. Ten students each mark off a randomly selected region of the field; each region is square and has side lengths of 1 meter, and no two regions overlap. The students count the earthworms contained in the soil to a depth of 5 centimeters beneath the grounds surface in each region. The results are shown in the table below.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>Which of the following is a reasonable approximation of the number of earthworms to a depth of 5 centimeters beneath the grounds surface in the entire field?</p>', 'A) 150||B) 1,500||C) 15,000||D) 150,000', '57714||57715||57716||57717', '57715', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(109, 25, 'MCQ-7590175771', 72847, 'multiple_questions_3', '<p>20.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p>Based on the histogram above, of the following, which is closest to the average (arithmetic mean) number of seeds per apple?</p>', 'A) 4||B) 5||C) 6||D) 7', '57718||57719||57720||57721', '57720', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(110, 26, 'MCQ-7590175771', 72828, 'multiple_questions_3', '<p>1.</p><p>Katarina is a botanist studying the production of pears by two types of pear trees. She noticed that Type A trees produced 20 percent more pears than Type B trees did. Based on Katarinas observation, if the Type A trees produced 144 pears, how many pears did the Type B trees produce?</p>', 'A) 115||B) 120||C) 124||D) 173', '57642||57643||57644||57645', '57644', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(111, 26, 'MCQ-7590175771', 72829, 'multiple_questions_3', '<p>2.</p><p>A food truck sells salads for $6.50 each and drinks for $2.00 each. The food trucks revenue from selling a total of 209 salads and drinks in one day was $836.50. How many salads were sold that day?</p>', 'A) 77||B) 93||C) 99||D) 105', '57646||57647||57648||57649', '57647', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(112, 26, 'MCQ-7590175771', 72830, 'multiple_questions_3', '<p>3.</p><p>Which of the following numbers is NOT a solution to the inequality 3x 5  4x 3?</p>', 'A) 1||B) 2||C) 3||D) 5', '57650||57651||57652||57653', '57650', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
(113, 26, 'MCQ-7590175771', 72831, 'multiple_questions_3', '<p>4.</p><p class=\"ql-align-center\">h = 3a + 28.6</p><p>A pediatrician uses the model above to estimate the height h of a boy, in inches, in terms of the boys age a, in years, between the ages of 2 and 5. Based on the model, what is the estimated increase, in inches, of a boys height each year?</p>', 'A) 3||B) 5.7||C) 9.5||D) 14.3', '57654||57655||57656||57657', '57654', NULL, '5', NULL, '2020-12-21 17:53:28', '2020-12-21 17:53:28'),
