INSERT INTO `pages` (`id`, `title`, `slug`, `content`, `etc`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Privacy', 'privacy', '<h2><strong>Career Counselling</strong></h2>\r\n\r\n<p>In this digital era, people are choosing freelancing to finance their lives. But many of them do not know to how to start their own careers in franchising by learning something.<br />\r\n<br />\r\nWe provide effective guidance on how the future of a student can be bright through which topic of learning and how to reach the cherished goals.<br />\r\n<br />\r\nIf anyone attends regular classes, submits all the home tasks, prepares projects in time, invests time sincerely in a selected course and has a winning attitude, he/she is must to reach his/her goal. Many of our students are reaching their desired careers while they&#39;re in the middle of the courses.<br />\r\n<br />\r\nWith every course offered we provide techniques and show all the possible ways to become a successful freelancer. We help you work and generate income as a freelancer. You will be able to know the effective ways to promote your work in online marketplaces very easily from our professionals without any cost.</p>', NULL, 1, '2020-10-12 22:29:19', '2020-10-12 23:31:37');
